import * as React from "react";

export function Recipe(props) {
  const {
    name,
    person,
    raw_cat,
    raw_recipe,
    ingreds,
    instructions,
    story,
    source,
    cooking_time,
    preheat_temp,
    servings,
    photos,
  } = props;

  return (
    <div>
      <h5>{name}</h5>
      <h3>{person}</h3>
      {ingreds
        .split("\n")
        .filter((i) => i)
        .map((i) => {
          <li>{i}</li>;
        })}
    </div>
  );
}
